import ProductSale from "../components/ProductSale";

const Featured = () => {
  const items = [
    {
      src: "../images/Brow routine essential_ Benefit's Precisely, My Brow Pencil.jpeg",
      price: "$25.00",
      alt: "Brow Gel",
    },
    {
      src: "../images/browset.jpeg",
      price: "$30.00",
      alt: "Brow Gel",
    },
  ];

  return (
    <section class="featured">
      <div class="featured-items">
        {items.map((a) => {
          <ProductSale item={a} class="grid-item" />;
        })}
      </div>
      <div class="featured-video">
        <iframe
          src="https://assets.pinterest.com/ext/embed.html?id=187040190766436100"
          height="714"
          width="345"
          frameborder="0"
          title="How to do your eyebrows"
        ></iframe>
      </div>
    </section>
  );
};

export default Featured;
